@kosModel({ modelTypeId: MODEL_TYPE, singleton: true })
export class CounterModel implements IKosDataModel {
  id: string;
  count = 0;

  constructor(modelId: string) {
    this.id = modelId;
  }

  increment() {
    this.count += 1;
  }
}

